			"on_start_level": "if(not level.player.vars.stored_events['town_elder_fight_won'],remove_object(me))",
			"on_talk": "speech_dialog(
							set(level.player.animation, 'emote_raisedfinger'),
			level.player,	[~Wow, so they seriously just packed up and left?
That's amazing!~],
			self,			[~Tell me about it.~],
							set(level.player.animation, 'emote_confused'),
			level.player,	[~So, how did you get out of your cage?~],
			self,			[~Well, they just let me out.~],
							set(level.player.animation, 'emote_oh'),
			level.player,	[~What?!
They ... as in Milgram's kitties?~],
			self,			[~^Yeah.~],
							set(level.player.animation, 'emote_confused'),
			level.player,	[~Weird.. that doesn't make any sense!
Why would they just let you go?~],
							set(level.player.animation, 'emote_geez'),
							[~That seems like an enormous waste of effort.~],
			self,			[~Yeah, this whole day has just been ... bizarre.~], 
							[~I've been thinking about that part,
and I have a hunch.~],
							[~I think the rank-and-file weren't
given very specific orders.~],
							[~I don't think they were told
what they were looking for.~],
							[~I think they were just told
to secure the place.~],
							[~Just arresting everyone is a strange way
to do it, but I guess it's not so weird
if you've got lots of manpower to spare.~],
							[~If they were just looking for the elder
and didn't care about ticking people off,
it's one way to make sure he couldn't slip away.~],
							set(level.player.animation, 'emote_confused'),
			level.player,	[~Well, is that really who they were after?~],
			self,			[~Yeah, one of their head guys showed me
a drawing of him.~],
							[~He asked me if I knew who it was.~],
							set(level.player.animation, 'emote_confused'),
			level.player,	[~That's very interesting...~],
							set(level.player.animation, 'emote_raisedfinger'),
							[~Suddenly their motives don't seem
so cut and dry.~],
							set(level.player.animation, 'emote_talk'),
							[~Strange..~],
							set(level.player.animation, 'emote_raisedfinger'),
							[~Anyways, not sure if you heard this part,
but I'm about to take a little trip.~],
			self,			[~No, I didn't hear this.~],
							set(level.player.animation, 'emote_oh'),
			level.player,	[~Yeah, I'm a little worried about
what might happen if someone doesn't
get in touch with Milgram.~],
							set(level.player.animation, 'emote_impatient'),
							[~That old clown was just sabre-rattling
about raising a militia.~],
							set(level.player.animation, 'emote_geez'),
							[~You don't think he could actually
pull that off, do you?~],
			self,			[~Nah, this town doesn't have the fire for that.
Which is a shame in some ways, but ...~],
							[~It's probably for the best, really,
I can't imagine the mess if people actually
got to fighting over stuff they disagreed about.~],
							set(level.player.animation, 'emote_raisedfinger'),
			level.player,	[~I guess I'm also worried about the other end;
what Milgram is doing, et cetera.~],
							set(level.player.animation, 'emote_confused'),
							[~I don't know; it's a little crazy to do this,
but I've kinda been itching for something
worthwhile to do.~],
							set(level.player.animation, 'emote_raisedfinger'),
							[~Good excuse to get out and travel a bit.
See the island.~],
			self,			[~Risky business, though, isn't it?~],
							set(level.player.animation, 'emote_talk'),
			level.player,	[~Oh, no question.~],
							set(level.player.animation, 'emote_geez'),
							[~Can't be worse than the crap I have
to deal with just coming into town, though.~],
							set(level.player.animation, 'emote_confused'),
							[~Who knows?
Maybe something good will come of it?~],
			self,			[~Well, good luck!
I'll be around.~]
							
				)",
